[[package]]
name = "about-time"
version = "3.1.1"
summary = "Easily measure timing and throughput of code blocks, with beautiful human friendly representations."

[[package]]
name = "aiofiles"
version = "0.8.0"
requires_python = ">=3.6,<4.0"
summary = "File support for asyncio."

[[package]]
name = "alive-progress"
version = "2.4.1"
requires_python = ">=3.7, <4"
summary = "A new kind of Progress Bar, with real-time throughput, ETA, and very cool animations!"
dependencies = [
    "about-time==3.1.1",
    "grapheme==0.6.0",
]

[[package]]
name = "anyio"
version = "3.6.1"
requires_python = ">=3.6.2"
summary = "High level compatibility layer for multiple asynchronous event loop implementations"
dependencies = [
    "idna>=2.8",
    "sniffio>=1.1",
]

[[package]]
name = "certifi"
version = "2022.6.15"
requires_python = ">=3.6"
summary = "Python package for providing Mozilla's CA Bundle."

[[package]]
name = "colorama"
version = "0.4.5"
requires_python = ">=2.7, !=3.0.*, !=3.1.*, !=3.2.*, !=3.3.*, !=3.4.*"
summary = "Cross-platform colored terminal text."

[[package]]
name = "commonmark"
version = "0.9.1"
summary = "Python parser for the CommonMark Markdown spec"

[[package]]
name = "grapheme"
version = "0.6.0"
summary = "Unicode grapheme helpers"

[[package]]
name = "h11"
version = "0.12.0"
requires_python = ">=3.6"
summary = "A pure-Python, bring-your-own-I/O implementation of HTTP/1.1"

[[package]]
name = "httpcore"
version = "0.15.0"
requires_python = ">=3.7"
summary = "A minimal low-level HTTP client."
dependencies = [
    "anyio==3.*",
    "certifi",
    "h11<0.13,>=0.11",
    "sniffio==1.*",
]

[[package]]
name = "httpx"
version = "0.23.0"
requires_python = ">=3.7"
summary = "The next generation HTTP client."
dependencies = [
    "certifi",
    "httpcore<0.16.0,>=0.15.0",
    "rfc3986[idna2008]<2,>=1.3",
    "sniffio",
]

[[package]]
name = "idna"
version = "3.3"
requires_python = ">=3.5"
summary = "Internationalized Domain Names in Applications (IDNA)"

[[package]]
name = "loguru"
version = "0.6.0"
requires_python = ">=3.5"
summary = "Python logging made (stupidly) simple"
dependencies = [
    "colorama>=0.3.4; sys_platform == \"win32\"",
    "win32-setctime>=1.0.0; sys_platform == \"win32\"",
]

[[package]]
name = "pygments"
version = "2.13.0"
requires_python = ">=3.6"
summary = "Pygments is a syntax highlighting package written in Python."

[[package]]
name = "rfc3986"
version = "1.5.0"
summary = "Validating URI References per RFC 3986"

[[package]]
name = "rfc3986"
version = "1.5.0"
extras = ["idna2008"]
summary = "Validating URI References per RFC 3986"
dependencies = [
    "idna",
    "rfc3986==1.5.0",
]

[[package]]
name = "rich"
version = "12.5.1"
requires_python = ">=3.6.3,<4.0.0"
summary = "Render rich text, tables, progress bars, syntax highlighting, markdown and more to the terminal"
dependencies = [
    "commonmark<0.10.0,>=0.9.0",
    "pygments<3.0.0,>=2.6.0",
]

[[package]]
name = "sniffio"
version = "1.2.0"
requires_python = ">=3.5"
summary = "Sniff out which async library your code is running under"

[[package]]
name = "tenacity"
version = "8.0.1"
requires_python = ">=3.6"
summary = "Retry code until it succeeds"

[[package]]
name = "win32-setctime"
version = "1.1.0"
